import React from 'react';
import './index.css';

export default function About() {
    return (
        <div id="about" className="mt-5 mb-5">
            <h2>about me ✧*･ﾟ✧</h2>
            <p>Hi, I'm Sara! I am a 4th year student at the University of Southern California.<br></br>
            In addition to programming, I am a multimedia artist!<br></br>
            I am passionate about creating tech that is as beautiful to see as it is to use. <br></br>
            With my knowledge of art, design, and code, I create tech that is approachable, friendly,
            and enjoyable.<br></br>
            I focus mainly on websites and games. I also design ui and art for projects.</p>
            <h4>what I do</h4>
            <ul>
                <li>Work as a TA for web development classes at USC, including ITP104 (Web Publishing)
                    and ITP301 (Front-End Web Development)
                </li>
                <li>Graphic design for USC Student Affairs</li>
            </ul>
        </div>
    );
}
